const data = [
  {
    image:"../images/20-05-ark-hero-open-graph.jpg",
    title:"Nohs ark"
  },
  {
    image:"../images/BIBLICAL-ARCHAEOLOGY-Unveiling-the-Mystery-The-Landing-of-Noahs-Ark-on-the-Mountains-of-Ararat-02.jpg",
    title:"Nohs ark"
  },
  {
    image:"../images/hands-bible-wooden-table.jpg",
    title:"bible"
  },
  {
    image:"../images/holy-bible-rosary-beads-wooden-table.jpg",
    title:"christian"
  },
  {
    image:"../images/spirituality-religion-hands-folded-prayer-holy-bible-church-concept-faith.jpg",
    title:"pray"
  }
]
function Home() {
  return (
  <div className='h-screen  bg-slate-600 pt-10'>
    <div className='h-[400px] w-3/4 m-auto border'>
        {      
        data.map((item,index)=>{
          return <div>
            <img src={item.image} className='w-40 h=40 object-contain'></img>
            </div>
        })
        }    
        <div className='p-6 bg-blue-600'>
            <p className='font-semibold text-white'>{item.title}</p>
        </div>

    </div>
  </div>

  )
}

export default Home;
